int readvar_double(ADIOS_FILE *fh, int varid, const int64_t start[], const int64_t count[], void* double_arr) {
  int result, i;
  ADIOS_VARINFO * v;
  ADIOS_SELECTION * sel;

  v = adios_inq_var_byid (fh, varid);

  printf("=== readvar_val ===\n");
  printf("fh: %p\n", fh);
  printf("varid: %d\n", varid);
  printf("start: ");
  for (i=0; i<v->ndim; i++)
    printf("%lld ", start[i]);
  printf("\n");
  printf("count: ");
  for (i=0; i<v->ndim; i++)
    printf("%lld ", count[i]);
  printf("\n");

  sel = adios_selection_boundingbox (v->ndim, (const uint64_t *)start, (const uint64_t *)count);
  result = adios_schedule_read_byid (fh, sel, varid, 0, 1, double_arr);
  adios_perform_reads (fh, 1);

  adios_selection_delete (sel);
  adios_free_varinfo (v);
  return result;
}


